INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2024/10/31 12:00:00", 100, "2030/01/01 14:59:59", -416.5, 3001100, 0.0, 2, 1, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 130011, "ヤマト", 3001, 2.1);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2024/10/31 12:00:00", 101, "2030/01/01 14:59:59", -416.5, 3001101, 0.0, 2, 4, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 130011, "ヤマト", 3001, 5.68);
