INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("2024/10/31 12:00:00", 100, "2030/01/01 14:59:59", -416.5, 3002100, 0.0, 1, 1, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 130211, "フブキ", 3002, 0.0);
